import React, { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { toggleMenu } from "./utils/appSlice";

const Header = () => {
  const dispatch = useDispatch();
  const [searchData, setSearchData] = useState("");
  const [suggestions, setSuggestions] = useState([]);
  console.log(searchData);

  const toggleMenuHandler = () => {
    dispatch(toggleMenu());
  };

  useEffect(() => {
    const timer = setTimeout(() => {
      fetchData();
    }, 2000);

    return () => {
      clearTimeout(timer);
    };
  }, [searchData]);

  const fetchData = async () => {
    const api = await fetch(
      "http://suggestqueries.google.com/complete/search?client=firefox&ds=yt&q=" +
        searchData
    );
    const result = await api.json();
    console.log(result[1]);
    setSuggestions(result[1]);
  };

  return (
    <div className="grid grid-flow-col justify-between r m-2 p-2">
      <div className="flex col-span-1 items-center">
        <img
          onClick={toggleMenuHandler}
          className="cursor-pointer w-12 h-12"
          src="data:image/png;base64,"
          alt="menu"
        />
        {/* <Link to="/"> */}
        <img
          className="w-24 h-22"
          src="data:image/png;base64,"
          alt="logo"
        />
        {/* </Link> */}
      </div>

      <div className="flex flex-col col-span-10 items-center">
        <div className=" w-6/12 ">
          <div className="flex justify-center w-full">
            <input
              className="border rounded-l-full w-full h-12 px-8"
              type="text"
              name="search"
              id=""
              onChange={(e) => setSearchData(e.target.value)}
            />
            <button className="rounded-r-full border h-12 px-8">
              <img
                className="w-5 h-5"
                src="https://cdn-icons-png.flaticon.com/512/54/54481.png"
                alt=""
              />
            </button>
          </div>

          <div className="flex justify-start">
            <div className="p-4 mt-4 shadow-2xl border border-gray-200 rounded-xl absolute bg-white w-[38rem]">
              <ul>
                <li>I phone</li>
                <li>I phone</li>
                <li>I phone</li>
                <li>I phone</li>
                <li>I phone</li>
                <li>I phone</li>
                <li>I phone</li>
              </ul>
            </div>
          </div>
        </div>
      </div>

      <div className="flex col-span-1 items-center">
        <img
          className="w-8 h-8 mx-4"
          src="data:image/png;base64,"
          alt="rec"
        />
        <img
          className="w-8 h-8 mx-4"
          src="data:image/png;base64,"
          alt="user"
        />
      </div>
    </div>
  );
};

export default Header;
